import React from "react";
import "../Styles/Home.css";

export default function Home() {
  return (
    <div className="wrapper">
      <div className="welcome">
        <p className="welcome">Welcome</p>
        <p>Hello Programmer...</p>
        <p>
          This is my Blog Page for sharing my knowledge and love for programming
          and help as many people I can.
        </p>
      </div>
      <p className="about">About Me</p>
      <div className="about-wrapper"></div>
      <p className="follow">Follow Me</p>
      <div className="follow-wrapper"></div>
      <section className="Contact-wrapper"></section>
    </div>
  );
}
